// --- MAIN REPORT COMPONENT ---

const Reports: React.FC = () => {
    const { setLoading, isLoading } = useApp();
    const [reportType, setReportType] = useState<string>('sampul');
    const [zoomLevel, setZoomLevel] = useState(1);
    
    // Data States
    const [students, setStudents] = useState<Student[]>([]);
    const [identity, setIdentity] = useState<IdentityData | null>(null);
    const [proker, setProker] = useState<ProkerItem[]>([]);
    const [jadwal, setJadwal] = useState<JadwalItem[]>([]);
    
    // Cache for single sheet data (Catatan Perkembangan / Leger)
    const [studentData, setStudentData] = useState<any>({});
    
    // Cache for aggregated meeting data (Laporan Semester)
    const [meetingReportData, setMeetingReportData] = useState<any[]>([]);
    
    // Selected Student for Individual Reports
    const [selectedStudentId, setSelectedStudentId] = useState<number | string>(1);

    const reportRef = useRef<HTMLDivElement>(null);

    // 1. Load Base Data
    useEffect(() => {
        const fetchBaseData = async () => {
            setLoading(true);
            try {
                const [s, i, p, j] = await Promise.all([
                    gasService.getStudents(),
                    gasService.getIdentity(),
                    gasService.getProker(),
                    gasService.getJadwal()
                ]);
                setStudents(s);
                if (s.length > 0) setSelectedStudentId(s[0].no);
                setIdentity(i);
                setProker(p);
                setJadwal(j);
            } catch (e) {
                console.error(e);
            } finally {
                setLoading(false);
            }
        };
        fetchBaseData();
    }, []);

    // 2. Fetch Report Specific Data
    useEffect(() => {
        const fetchData = async () => {
            if (['sampul', 'proker', 'jadwal', 'dataSiswa'].includes(reportType)) return;

            setLoading(true);
            try {
                if (reportType === 'catatanPerkembangan') {
                    // Fetch Leger Data
                    const data = await gasService.getGenericData('legerNilaiSemester');
                    const found = data.find((row: any) => String(row.No) === String(selectedStudentId));
                    setStudentData(found || {});
                } 
                else if (reportType === 'laporanSemester') {
                    // Fetch All Meetings (1-6)
                    const promises = [1, 2, 3, 4, 5, 6].map(num => gasService.getGenericData(`pertemuan${num}`));
                    const results = await Promise.all(promises);
                    
                    // Filter data for selected student across all sheets
                    const aggregated = results.map((sheetData, index) => {
                        const row = sheetData.find((r: any) => String(r.No) === String(selectedStudentId));
                        return {
                            pertemuanKe: index + 1,
                            data: row || null
                        };
                    });
                    setMeetingReportData(aggregated);
                }
            } catch (e) {
                console.error(e);
            } finally {
                setLoading(false);
            }
        };

        if (students.length > 0) {
            fetchData();
        }
    }, [reportType, selectedStudentId, students]);

    const handleDownloadPdf = () => {
        if (!reportRef.current) return;
        const element = reportRef.current;
        
        // Simpan style asli
        const originalStyle = {
            transform: element.style.transform,
            width: element.style.width,
            height: element.style.height,
            minHeight: element.style.minHeight,
            boxShadow: element.style.boxShadow,
            margin: element.style.margin,
            overflow: element.style.overflow
        };

        // Reset style agar pas di PDF
        element.style.transform = 'scale(1)';
        element.style.width = '210mm'; 
        element.style.height = 'auto'; 
        element.style.minHeight = '296mm'; // Pastikan minimal A4 full height
        element.style.boxShadow = 'none';
        element.style.margin = '0';
        element.style.overflow = 'visible';
        
        const fileName = `Laporan_${reportType}_${identity?.namaGuru || 'GuruWali'}.pdf`;

        // Konfigurasi Margin (Atas/Bawah sama 10mm, Kiri/Kanan 5mm)
        const opt = {
            margin: [10, 5, 10, 5], 
            filename: fileName,
            image: { type: 'jpeg', quality: 0.98 },
            html2canvas: {
                scale: 2,
                useCORS: true,
                scrollY: 0
            },
            jsPDF: { unit: 'mm', format: 'a4', orientation: 'portrait' },
            pagebreak: { mode: ['css', 'legacy'] }
        };

        setLoading(true);

        html2pdf().set(opt).from(element).toPdf().get('pdf').then((pdf: any) => {
             const pdfBase64 = pdf.output('datauristring');
             if (window.Android) {
                 window.Android.saveBlob(pdfBase64, fileName);
             } else {
                 pdf.save(fileName);
             }
             
             // Restore styles
             Object.assign(element.style, originalStyle);
             setLoading(false);
        }).catch((err: any) => {
            console.error(err);
            alert("Gagal mengunduh PDF");
            setLoading(false);
            // Restore styles
            Object.assign(element.style, originalStyle);
        });
    };
    
    // --- RENDER CONTENT SWITCHER ---
    const renderContent = () => {
        const selectedStudent = students.find(s => String(s.no) === String(selectedStudentId));
        
        switch(reportType) {
            case 'sampul':
                return <SampulView identity={identity} studentClass={students[0]?.class} />;
            case 'dataSiswa':
                return <DataSiswaView students={students} />;
            case 'proker':
                return <ProkerView proker={proker} />;
            case 'jadwal':
                 return <JadwalView jadwal={jadwal} />;
            case 'catatanPerkembangan':
                 return <CatatanPerkembanganView student={selectedStudent} identity={identity} studentData={studentData} />;
            case 'laporanSemester':
                return <LaporanSemesterView student={selectedStudent} identity={identity} meetingReportData={meetingReportData} />;
            default:
                return <div>Pilih jenis laporan</div>;
        }
    };

    return (
        <div className="flex flex-col h-screen overflow-hidden bg-gray-100 dark:bg-dark">
            {/* STICKY TOOLBAR */}
            <div className="sticky top-0 z-30 bg-white dark:bg-paperDark shadow-md p-4 no-print flex flex-col gap-4">
                {/* Row 1: Title & Main Info */}
                <div className="flex justify-between items-center">
                    <h1 className="text-xl font-bold text-gray-800 dark:text-white">Laporan</h1>
                </div>

                {/* Row 2: Controls & Actions */}
                <div className="flex flex-col md:flex-row gap-4 items-center justify-between">
                    
                    {/* Left: Selectors */}
                    <div className="flex flex-wrap items-center gap-3 w-full md:w-auto">
                        <div className="relative min-w-[200px]">
                            <select 
                                value={reportType} 
                                onChange={(e) => setReportType(e.target.value)}
                                className="w-full appearance-none bg-gray-50 dark:bg-gray-700 border border-gray-300 dark:border-gray-600 rounded-lg py-2 px-3 pr-8 text-sm font-medium focus:ring-2 focus:ring-primary outline-none transition-colors"
                            >
                                <option value="sampul">Sampul</option>
                                <option value="proker">Proker</option>
                                <option value="jadwal">Jadwal</option>
                                <option value="dataSiswa">Data Murid</option>
                                <option value="catatanPerkembangan">Catatan Perkembangan</option>
                                <option value="laporanSemester">Laporan Semester</option>
                            </select>
                            <ChevronDown size={14} className="absolute right-3 top-3 text-gray-500 pointer-events-none" />
                        </div>

                        {/* Student Selector (Conditional) */}
                        {!['sampul', 'proker', 'jadwal', 'dataSiswa'].includes(reportType) && (
                             <div className="relative min-w-[200px]">
                                <select 
                                    value={selectedStudentId} 
                                    onChange={(e) => setSelectedStudentId(e.target.value)}
                                    className="w-full appearance-none bg-gray-50 dark:bg-gray-700 border border-gray-300 dark:border-gray-600 rounded-lg py-2 px-3 pr-8 text-sm font-medium focus:ring-2 focus:ring-primary outline-none transition-colors"
                                >
                                    {students.map(s => <option key={s.no} value={s.no}>{s.no}. {s.name}</option>)}
                                </select>
                                <ChevronDown size={14} className="absolute right-3 top-3 text-gray-500 pointer-events-none" />
                            </div>
                        )}
                    </div>

                    {/* Right: Zoom & Download */}
                    <div className="flex items-center gap-2 shrink-0">
                        <div className="flex items-center bg-gray-50 dark:bg-gray-700 rounded-lg p-1 border dark:border-gray-600">
                            <button onClick={() => setZoomLevel(z => Math.max(0.5, z - 0.1))} className="p-1.5 hover:bg-gray-200 dark:hover:bg-gray-600 rounded text-gray-600 dark:text-gray-300 transition-colors"><ZoomOut size={16} /></button>
                            <span className="text-xs font-mono w-10 text-center select-none">{Math.round(zoomLevel * 100)}%</span>
                            <button onClick={() => setZoomLevel(z => Math.min(2, z + 0.1))} className="p-1.5 hover:bg-gray-200 dark:hover:bg-gray-600 rounded text-gray-600 dark:text-gray-300 transition-colors"><ZoomIn size={16} /></button>
                        </div>

                        <button 
                            onClick={handleDownloadPdf}
                            disabled={isLoading}
                            className="bg-primary hover:bg-blue-600 text-white px-4 py-2 rounded-lg text-sm font-medium flex items-center gap-2 shadow-sm transition-all active:scale-95 whitespace-nowrap disabled:opacity-50 disabled:cursor-not-allowed"
                        >
                            {isLoading ? <Loader2 size={16} className="animate-spin" /> : <Download size={16} />}
                            <span className="hidden sm:inline">Unduh PDF</span>
                        </button>
                    </div>
                </div>
            </div>

            {/* SCROLLABLE PREVIEW AREA */}
            <div className="flex-1 overflow-y-auto p-4 md:p-8 bg-gray-200 dark:bg-gray-900 flex justify-center">
                <div 
                    ref={reportRef}
                    style={{ transform: `scale(${zoomLevel})`, transformOrigin: 'top center' }}
                    className="bg-white shadow-2xl transition-transform duration-200 w-[210mm] min-h-[296mm] h-fit print-reset-zoom mx-auto"
                >
                    {renderContent()}
                </div>
            </div>
        </div>
    );
};

export default Reports;
